export default class FindObject {
    findType: string = '';
    zipCode: number = 0;
    distanceAway: number = 0;

    constructor(findType: string, zipCode: number, distanceAway: number) {
        this.findType = findType;
        this.zipCode = zipCode;
        this.distanceAway = distanceAway;
    }
}
